import { Typography } from '@mui/material';

import './SignUp.css';
const SignUp=()=>{
    return (
        <div className="signup">
             <ShoppingCartIcon
                    size="small"
                    edge="start"
                    color="inherit"
                    aria-label="menu"
                    sx={{ mr: 1 }}
                >
                    <MenuIcon />
                </ShoppingCartIcon>
                <Typography variant="h6"
                    component="div" sx={{ flexGrow: 1,textAlign:'center' }}>
                        
                    Sign Up</Typography>
        </div>
    )
}

export default SignUp;
